<!doctype html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=Edge">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>your library artist</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Inder:wght@400&display=swap" rel="stylesheet">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400&display=swap" rel="stylesheet">
    <link rel="stylesheet" href="your_library_artist.css" />
  </head>
  <body>
    <div class="your-library-artist">
      <div class="container-8">
        <div class="container-5">
          <div class="pm">
          1:12 PM
          </div>
          <div class="container-6">
            <div class="rectangle-212">
            </div>
            <div class="rectangle-221">
            </div>
          </div>
        </div>
        <div class="container-11">
          <div class="ellipse-2">
          </div>
          <div class="frame-16">
            <span class="your-library">
            Your library
            </span>
            <div class="container-2">
              <div class="rectangle-21">
              </div>
              <div class="rectangle-38">
              </div>
            </div>
          </div>
        </div>
        <div class="container-10">
          <div class="container-3">
            <span class="all">
            All
            </span>
          </div>
          <div class="container">
            <span class="artist">
            Artist
            </span>
          </div>
          <div class="container-7">
            <span class="playlist">
            Playlist
            </span>
          </div>
        </div>
        <div class="container-1">
          <div class="iconarrow-top">
            <img class="vector" src="../assets/vectors/vector_6_x2.svg" />
          </div>
          <div class="recents">
          Recents
          </div>
        </div>
        <div class="frame-17">
          <img class="ellipse-6" src="../assets/vectors/ellipse_63_x2.svg" />
          <div class="yo-yo-honey-singh">
          Yo Yo Honey Singh
          </div>
        </div>
        <div class="container-4">
          <img class="ellipse-7" src="../assets/vectors/ellipse_73_x2.svg" />
          <div class="arijit-singh">
          Arijit Singh
          </div>
        </div>
        <div class="container-9">
          <img class="ellipse-8" src="../assets/vectors/ellipse_81_x2.svg" />
          <div class="drake">
          Drake
          </div>
        </div>
        <div class="rewards">
          <div class="rectangle-22">
          </div>
          <span class="rewards-1">
          Rewards
          </span>
        </div>
      </div>
      <div class="rectangle-19">
      </div>
      <div class="home">
        <div class="rectangle-191">
        </div>
        <span class="home-1">
        Home
        </span>
      </div>
      <div class="search">
        <div class="rectangle-20">
        </div>
        <span class="search-1">
        Search
        </span>
      </div>
      <div class="libary">
        <img class="libary-1" src="../assets/vectors/libary_1_x2.svg" />
        <span class="your-lib">
        Your lib...
        </span>
      </div>
      <div class="premium">
        <div class="rectangle-211">
        </div>
        <span class="premium-1">
        Premium
        </span>
      </div>
      <div class="iconarrow-bottom">
        <img class="vector-1" src="../assets/vectors/vector_7_x2.svg" />
      </div>
    </div>

</html>
